import React from 'react'
import ReactDOM from 'react-dom'
import style from './css/main.css'


class App extends React.Component{
    constructor(){
        super()
        this.state = {searchValue: ''}

    }
    trya = async (e) =>{
        e.preventDefault()
        const APP_kEY = '30b680a61787c4eb4f211382ef68e0c9'
        const APP_ID ='6d7ac30d'
        const a = document.getElementById('a').value
        this.setState({searchValue : a})
        const apiURL = `https://api.edamam.com/search?q=chicken&app_id=${APP_ID}&app_key=${APP_kEY}`
        // const searchResult = await fetch(`${apiURL}`)
        // const data = await searchResult.json();
        // console.log(data)
        console.log(this.searchValue)

    }

    render() {
        return(
            <div className='form'>
                <label> Search Your Recipe</label>
                <form>
                    <input type='text' id='a' value={this.searchValue} />
                    <button onClick={this.trya}> Search </button>    
                </form> 
            </div>
        )
    }
}

ReactDOM.render(
    <App />,
    document.getElementById('root')
)
